'use strict';

import ESComplexModule  from 'typhonjs-escomplex-module/src/ESComplexModule.js';

import Plugins          from './Plugins.js';

/**
 * Provides a runtime to invoke ESComplexProject plugins for processing / metrics calculations of projects.
 */
export default class ESComplexProject
{
   /**
    * Initializes ESComplexProject.
    *
    * @param {object}   options - module and project options including user plugins to load including:
    * ```
    * (object)             module - Provides an object hash of the following options for the module runtime:
    *    (boolean)         loadDefaultPlugins - When false ESComplexModule will not load any default plugins.
    *    (Array<Object>)   plugins - A list of ESComplexModule plugins that have already been instantiated.
    *
    * (object)             project - Provides an object hash of the following options for the project runtime:
    *    (boolean)         loadDefaultPlugins - When false ESComplexProject will not load any default plugins.
    *    (Array<Object>)   plugins - A list of ESComplexProject plugins that have already been instantiated.
    * ```
    */
   constructor(options = {})
   {
      if (typeof options !== 'object') { throw new TypeError('ctor error: `options` is not an `object`.'); }

      this._plugins = new Plugins(options.project);

      this._escomplexModule = new ESComplexModule(options.module);
   }

   /**
    * Processes the given modules and calculates project metrics via plugins.
    *
    * @param {Array}    modules - Array of object hashes containing `ast` and `path` entries.
    * @param {object}   options - (Optional) project processing options.
    *
    * @returns {{reports: Array<{}>}}
    */
   analyze(modules, options = {})
   {
      if (!Array.isArray(modules)) { throw new TypeError('analyze error: `modules` is not an `array`.'); }
      if (typeof options !== 'object') { throw new TypeError('analyze error: `options` is not an `object`.'); }

      const settings = this._plugins.onConfigure(options);

      this._plugins.onProjectStart(settings);

      const reports = modules.map((m) =>
      {
         let report;

         if (m.path === '') { throw new Error('analyze error: Invalid path'); }

         try
         {
            report = this._escomplexModule.analyze(m.ast, options);
            report.path = m.path;
            return report;
         }
         catch (error)
         {
            // Include the module path to distinguish the actual offending entry.
            error.message = `${m.path}: ${error.message}`;
            throw error;
         }
      }, []);

      const results = { reports };

      if (settings.skipCalculation) { return results; }

      this._plugins.onProjectEnd(results);

      return results;
   }

   /**
    * Processes existing project results and calculates metrics via plugins.
    *
    * @param {object}   results - An object hash with a `reports` entry that is an Array of module results.
    * @param {object}   options - (Optional) project processing options.
    *
    * @returns {{reports: Array<{}>}}
    */
   processResults(results, options = {})
   {
      if (typeof results !== 'object') { throw new TypeError('processResults error: `results` is not an `object`.'); }
      if (typeof options !== 'object') { throw new TypeError('processResults error: `options` is not an `object`.'); }

      const settings = this._plugins.onConfigure(options);

      this._plugins.onProjectStart(settings);
      this._plugins.onProjectEnd(results);

      return results;
   }

   // Asynchronous Promise based methods ----------------------------------------------------------------------------

   /**
    * Wraps in a Promise processing the given modules and calculates metrics via plugins.
    *
    * @param {Array}    modules - Array of object hashes containing `ast` and `path` entries.
    * @param {object}   options - project processing options
    *
    * @returns {Promise<{reports: Array<{}>}>}
    */
   analyzeThen(modules, options = {})
   {
      return new Promise((resolve, reject) =>
      {
         try { resolve(this.analyze(modules, options)); }
         catch (err) { reject(err); }
      });
   }

   /**
    * Wraps in a Promise processing of existing project results and calculates metrics via plugins.
    *
    * @param {object}   results - An object hash with a `reports` entry that is an Array of module results.
    * @param {object}   options - (Optional) project processing options.
    *
    * @returns {Promise<{reports: Array<{}>}>}
    */
   processResultsThen(results, options = {})
   {
      return new Promise((resolve, reject) =>
      {
         try { resolve(this.processResults(results, options)); }
         catch (err) { reject(err); }
      });
   }
}

'use strict';

import PluginManager          from 'typhonjs-plugin-manager';

import PluginMetricsProject   from 'escomplex-plugin-metrics-project/src/PluginMetricsProject.js';

/**
 * Provides a wrapper around PluginManager for ESComplexProject. Several convenience methods for the plugin callbacks
 * properly manage and or create initial data that are processed by the plugins.
 *
 * The default plugins loaded include:
 * @see https://www.npmjs.com/package/escomplex-plugin-metrics-project
 */
export default class Plugins
{
   /**
    * Initializes Plugins.
    *
    * @param {object}   options - module options including user plugins to load including:
    * ```
    * (boolean)         loadDefaultPlugins - When false ESComplexProject will not load any default plugins.
    * (Array<Object>)   plugins - A list of ESComplexProject plugins that have already been instantiated.
    * ```
    */
   constructor(options = {})
   {
      this._pluginManager = new PluginManager();

      if (typeof options.loadDefaultPlugins === 'boolean' && !options.loadDefaultPlugins) { /* nop */ }
      else
      {
         this._pluginManager.addPlugin(new PluginMetricsProject());
      }
   }

   /**
    * Initializes the default `settings` object hash and then invokes the `onConfigure` plugin callback for all loaded
    * plugins.
    *
    * @param {object}   options - (Optional) project processing options.
    *
    * @returns {object}
    */
   onConfigure(options)
   {
      /**
       * Default settings with potential user override of `skipCalculation`.
       * @type {{skipCalculation: boolean}}
       */
      const settings =
      {
         skipCalculation: typeof options.skipCalculation === 'boolean' ? options.skipCalculation : false
      };

      const event = this._pluginManager.invoke('onConfigure', { options, settings }, true);
      return event !== null ? event.data.settings : settings;
   }

   /**
    * Initializes the default `report` object hash and then invokes the `onProjectStart` plugin callback for all loaded
    * plugins.
    *
    * @param {object}   settings - Settings for project processing.
    */
   onProjectStart(settings)
   {
      this._pluginManager.invoke('onProjectStart', { settings }, false);
   }

   /**
    * Invokes the `onProjectEnd` plugin callback for all loaded plugins such they might finish calculating results.
    *
    * @param {{reports: Array<{}>}} results -
    *
    * @returns {{reports: Array<{}>}}
    */
   onProjectEnd(results)
   {
      const event = this._pluginManager.invoke('onProjectEnd', { results }, false);
      return event !== null ? event.data.results : results;
   }
}

'use strict';

import ESComplexProject from './ESComplexProject.js';

/**
 * Exports the default instance of ESComplexProject which is associated with the main entry in `package.json`.
 * It should be noted that this default instance doesn't accept user options for ESComplexProject initialization.
 */
export default new ESComplexProject();
